import React from 'react'
import "./ShoppingCart.css"
import ListProducts from "../tabProduct/ListProducts"
import Cards from "../tabProduct/GalleryReact"

const ShoppingCart = () => {
  return (
    <div className=' containerCart'>
    <section>
      ListProducts.map(item)=>(
        <Cards key={item.id}/>
      ))
    </section>
  </div>
  )
}

export default ShoppingCart
